-- Role: from your data (admin, participant)
CREATE TYPE role_enum AS ENUM ('participant', 'admin');

-- U.S. state abbreviations (you can trim if you only care about UT)
CREATE TYPE state_enum AS ENUM (
  'AL','AK','AZ','AR','CA','CO','CT','DE','FL','GA',
  'HI','ID','IL','IN','IA','KS','KY','LA','ME','MD',
  'MA','MI','MN','MS','MO','MT','NE','NV','NH','NJ',
  'NM','NY','NC','ND','OH','OK','OR','PA','RI','SC',
  'SD','TN','TX','UT','VT','VA','WA','WV','WI','WY'
);

-- Field of interest: from your dataset
CREATE TYPE field_of_interest_enum AS ENUM ('STEM', 'Arts', 'Both');

-- Event recurrence: from your dataset
CREATE TYPE event_recurrence_enum AS ENUM ('Weekly', 'Monthly', 'Annual');

-- Registration status: from your dataset
CREATE TYPE registration_status_enum AS ENUM ('attended', 'cancelled', 'no-show');

-- NPS bucket: from your dataset
CREATE TYPE surveynpsbucket_enum AS ENUM ('Detractor', 'Passive', 'Promoter');


CREATE TABLE Persons (
    PersonID        SERIAL PRIMARY KEY,
    Username        VARCHAR(30) NOT NULL UNIQUE,
    Password        VARCHAR(100) NOT NULL UNIQUE,
    Email           VARCHAR(255) NOT NULL UNIQUE,
    FirstName       VARCHAR(100) NOT NULL,
    LastName        VARCHAR(100) NOT NULL,
    DateOfBirth     DATE,
    Role            role_enum NOT NULL,
    Phone           VARCHAR(25),
    City            VARCHAR(100),
    State           state_enum,
    ZipCode         VARCHAR(10),
    Organization    VARCHAR(255),
    FieldOfInterest field_of_interest_enum,
    TotalDonations  NUMERIC(10,2)
);

CREATE TABLE Events (
    EventID              SERIAL PRIMARY KEY,
    EventName            VARCHAR(255) NOT NULL UNIQUE,
    EventType            VARCHAR(100),
    EventDescription     TEXT,
    EventRecurrence      event_recurrence_enum,
    EventDefaultCapacity INTEGER
);

CREATE TABLE EventInstances (
    EventID                   INTEGER NOT NULL,
    EventStart                TIMESTAMP WITHOUT TIME ZONE NOT NULL,
    EventEnd                  TIMESTAMP WITHOUT TIME ZONE,
    EventLocation             VARCHAR(255),
    EventCapacity             INTEGER,
    EventRegistrationDeadline TIMESTAMP WITHOUT TIME ZONE,
    CONSTRAINT pk_eventinstances PRIMARY KEY (EventID, EventStart),
    CONSTRAINT fk_eventinstances_event
        FOREIGN KEY (EventID)
        REFERENCES Events(EventID)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

CREATE TABLE Attendance (
    PersonID                  INTEGER NOT NULL,
    EventID                   INTEGER NOT NULL,
    EventStart                TIMESTAMP WITHOUT TIME ZONE NOT NULL,
    RegistrationStatus        registration_status_enum NOT NULL,
    RegistrationCheckInTime   TIMESTAMP WITHOUT TIME ZONE,
    RegistrationCreatedAt     TIMESTAMP WITHOUT TIME ZONE,
    SurveySatisfactionScore   SMALLINT,
    SurveyUsefulnessScore     SMALLINT,
    SurveyInstructorScore     SMALLINT,
    SurveyRecommendationScore SMALLINT,
    SurveyOverallScore        NUMERIC(3,2),
    SurveyComments            TEXT,
    SurveySubmissionDate      TIMESTAMP WITHOUT TIME ZONE,
    CONSTRAINT pk_attendance PRIMARY KEY (PersonID, EventID, EventStart),
    CONSTRAINT fk_attendance_person
        FOREIGN KEY (PersonID)
        REFERENCES Persons(PersonID)
        ON UPDATE CASCADE
        ON DELETE CASCADE,
    CONSTRAINT fk_attendance_eventinstance
        FOREIGN KEY (EventID, EventStart)
        REFERENCES EventInstances(EventID, EventStart)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

CREATE TABLE Milestones (
    PersonID        INTEGER NOT NULL,
    MilestoneNumber INTEGER NOT NULL,
    MilestoneTitle  VARCHAR(255) NOT NULL,
    MilestoneDate   DATE,
    CONSTRAINT pk_milestones PRIMARY KEY (PersonID, MilestoneNumber),
    CONSTRAINT fk_milestones_person
        FOREIGN KEY (PersonID)
        REFERENCES Persons(PersonID)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

CREATE TABLE Donations (
    PersonID        INTEGER NOT NULL,
    DonationNumber  INTEGER NOT NULL,
    DonationDate    DATE,
    DonationAmount  NUMERIC(10,2),
    CONSTRAINT pk_donations PRIMARY KEY (PersonID, DonationNumber),
    CONSTRAINT fk_donations_person
        FOREIGN KEY (PersonID)
        REFERENCES Persons(PersonID)
        ON UPDATE CASCADE
        ON DELETE CASCADE
);

CREATE TABLE NPSBuckets (
    SurveyRecommendationScore SMALLINT PRIMARY KEY,
    SurveyNPSBucket           surveynpsbucket_enum NOT NULL
);

ALTER TABLE Attendance
ADD CONSTRAINT fk_attendance_npsbucket
    FOREIGN KEY (SurveyRecommendationScore)
    REFERENCES NPSBuckets(SurveyRecommendationScore)
    ON UPDATE CASCADE
    ON DELETE RESTRICT;








